INSERT INTO `tbl_catalog_elements` VALUES (50412, 1, 0, 'Шуба 1', '', 1, 0, 0, 0, NULL, 0, 'jpg', 'Шуба 1', '<p>Ещё одна интересная модель полупальто из меха лисы со вставками из меха норки. Элегантные вставки из норки прекрасно сочетаются с лисьим мехом делая изделие по особому стильным и грациозным. Шубы из лисы очень теплые и прекрасно греют в самые холодные морозы за счет того, что обладают густым и длинным ворсом. Это можно сказать и про данное полупальто. Кроме этого, мех лисы очень мягкий и нежный в чем Вы сразу же убедитесь, когда прикоснетесь к этой шубе. В такую шубу из натурального меха лисы просто не возможно не влюбиться! Шуба из лисы – это яркий стиль, изумительное очарование и неповторимость. Если Вы хотите выделиться из толпы и привнести в свою повседневную жизнь немного роскоши и красок, Вам нужно это полупальто из меха лисы.</p>', '', '', NULL, 0, 0, 0, NULL);
